/*
REQUIREMENTS_BEGIN
{
    "chart_type": "Vertical Bar Chart",
    "chart_name": "vertical_bar_chart_20",
    "required_fields": ["x", "y"],
    "required_fields_type": [["categorical"], ["numerical"]],
    "required_fields_range": [[3, 7], [0, 100]],
    "required_fields_icons": ["x"],
    "required_other_icons": [],
    "required_fields_colors": [],
    "required_other_colors": [],
    "supported_effects": ["gradient", "opacity"],
    "min_height": 600,
    "min_width": 800,
    "background": "light",
    "icon_mark": "none",
    "icon_label": "none",
    "has_x_axis": "yes",
    "has_y_axis": "yes"
}
REQUIREMENTS_END
*/


function makeChart(containerSelector, data) {
    // ---------- 1. 数据准备阶段 ----------
    
    // 提取数据和配置
    const jsonData = data;                       // 完整的JSON数据对象
    const chartData = jsonData.data.data;        // 实际数据点数组  
    const variables = jsonData.variables || {};  // 图表配置
    const typography = jsonData.typography || {  // 字体设置，如果不存在则使用默认值
        title: { font_family: "Arial", font_size: "18px", font_weight: "bold" },
        label: { font_family: "Arial", font_size: "14px", font_weight: "normal" },
        description: { font_family: "Arial", font_size: "14px", font_weight: "normal" },
        annotation: { font_family: "Arial", font_size: "12px", font_weight: "normal" }
    };
    const images = jsonData.images || { field: {}, other: {} };
    const colors = jsonData.colors || { 
        text_color: "#333333",
        other: { 
            primary: "#D32F2F",    // Red for "Still active"
            secondary: "#AAAAAA",  // Gray for "Ended"
            background: "#F0F0F0" 
        }
    };  // 颜色设置
    const dataColumns = jsonData.data.columns || []; // 数据列定义
    
    // 设置视觉效果变量的默认值
    variables.has_shadow = variables.has_shadow || false;
    variables.has_stroke = variables.has_stroke || false;
    
    // 清空容器
    d3.select(containerSelector).html("");
    
    // ---------- 2. 尺寸和布局设置 ----------
    
    // 设置图表总尺寸
    const width = variables.width || 600;
    const height = variables.height || 400;
    
    // 设置边距
    const margin = {
        top: 50,
        right: 30,
        bottom: 80,
        left: 40
    };
    
    // 计算实际绘图区域大小
    const chartWidth = width - margin.left - margin.right;
    const chartHeight = height - margin.top - margin.bottom;
    
    // ---------- 3. 提取字段名和单位 ----------
    
    // 根据数据列获取字段名
    const xField = dataColumns.find(col => col.role === "x")?.name || "period";
    const yField = dataColumns.find(col => col.role === "y")?.name || "value";
    
    // 获取字段单位（如果存在）
    let xUnit = "";
    let yUnit = "";
    let groupUnit = "";
    
    if (dataColumns.find(col => col.role === "x")?.unit !== "none") {
        xUnit = dataColumns.find(col => col.role === "x").unit;
    }
    
    if (dataColumns.find(col => col.role === "y")?.unit !== "none") {
        yUnit = dataColumns.find(col => col.role === "y").unit;
    }

    
    // ---------- 4. 数据处理 ----------
    
    // 处理数据，确保数据格式正确
    const processedData = chartData.map(d => ({
        category: d[xField],
        value: +d[yField] // 确保转换为数字
    }));
    // ---------- 5. 创建比例尺 ----------
    
    // X轴比例尺 - 使用分类数据
    const xScale = d3.scaleBand()
        .domain(processedData.map(d => d.category))
        .range([0, chartWidth])
        .padding(0.3);
    
    // Y轴比例尺 - 使用数值
    const yScale = d3.scaleLinear()
        .domain([0, d3.max(processedData, d => d.value)])
        .range([chartHeight, 0])
        .nice();

    // 颜色比例尺
    const colorScale = (d, i) => {
        console.log(i)
        if (i === 0) {
            // 第一个柱子使用更深的颜色
            return d3.rgb(colors.other.primary).darker(0.7);
        }
        // 其他柱子使用primary颜色
        return colors.other.primary;
    };


    // 确定标签的最大长度：
    let minXLabelRatio = 1.0
    const maxXLabelWidth = xScale.bandwidth() * 1.03

    chartData.forEach(d => {
        // x label
        const xLabelText = String(d[xField])
        let currentWidth = getTextWidth(xLabelText)
        if (currentWidth > maxXLabelWidth) {
            minXLabelRatio = Math.min(minXLabelRatio, maxXLabelWidth / currentWidth)
        }
    })


    const imageBase64 = "data:image/png;base64,"

    // ---------- 6. 创建SVG容器 ----------
    
    const svg = d3.select(containerSelector)
        .append("svg")
        .attr("width", "100%")
        .attr("height", height)
        .attr("viewBox", `0 0 ${width} ${height}`)
        .attr("style", "max-width: 100%; height: auto;")
        .attr("xmlns", "http://www.w3.org/2000/svg")
        .attr("xmlns:xlink", "http://www.w3.org/1999/xlink");
    
    // 添加图表主体容器
    const chartGroup = svg.append("g")
        .attr("transform", `translate(${margin.left}, ${margin.top})`);
    
    // ---------- 7. 绘制图表元素 ----------
    
    // 添加X轴
    const xAxis = d3.axisBottom(xScale)
        .tickSize(0); // 移除刻度线
    
    chartGroup.append("g")
        .attr("class", "x-axis")
        .attr("transform", `translate(0, ${chartHeight})`)
        .call(xAxis)
        .call(g => g.select(".domain").remove())  // 移除轴线
        .selectAll("text")
        .style("font-family", typography.label.font_family)
        .style("font-size", typography.label.font_size)
        .style("text-anchor", minXLabelRatio < 1.0 ? "end" : "middle")
        .attr("transform", minXLabelRatio < 1.0 ? "rotate(-45)" : "rotate(0)") 
        .style("fill", colors.text_color);
    
    // 添加Y轴
    const yAxis = d3.axisLeft(yScale)
        .ticks(5)
        .tickFormat(d => d + (yUnit ? ` ${yUnit}` : ''))
        .tickSize(0)          // 移除刻度线
        .tickPadding(10);     // 增加文字和轴的间距
    
    chartGroup.append("g")
        .attr("class", "y-axis")
        .call(yAxis)
        .call(g => g.select(".domain").remove())  // 移除轴线
        .selectAll("text")
        .remove()
    
    // 添加条形
    const bars = chartGroup.selectAll(".bar")
        .data(processedData)
        .enter()
        .append("g")
        .attr("class", "bar-group")
        .attr("transform", (d, i) => `translate(${xScale(d.category)}, -${i*50})`);

    // 计算图片的宽高比
    const imgAspectRatio = 1

    // 为每个柱子添加图片叠加
    bars.each(function(d) {
        const barHeight = chartHeight - yScale(d.value);
        const barWidth = xScale.bandwidth();
        
        // 计算单个图片的尺寸
        const imgWidth = barWidth;
        const imgHeight = imgWidth / imgAspectRatio;
        
        // 计算需要叠加的图片数量
        const numImages = Math.ceil(barHeight / imgHeight)/0.353;
        
        // 创建图片叠加
        for (let i = 0; i < numImages; i++) {
            d3.select(this)
                .append("image")
                .attr("xlink:href", imageBase64)
                .attr("x", 0)
                .attr("y", chartHeight-imgHeight*0.7 - (i + 1) * imgHeight*0.105)
                .attr("width", imgWidth)
                .attr("height", imgHeight);
        }
    });

    // Add country icons with labels and connecting lines
    const iconSize = 30; // Size of the circular country icon
    const labelOffsetX = iconSize + 5; // Horizontal offset for labels from icon
    const labelGap = 20; // Vertical gap between dimension and value labels
    
    const countryIcons = chartGroup.selectAll(".country-icon-group")
        .data(processedData)
        .enter()
        .append("g")
        .attr("class", "country-icon-group")
        .attr("transform", (d, i) => {
            const currentDataPoint = d;
            const currentIndex = i; // index of the bar in processedData

            // Calculate dimensions and number of images, consistent with bars.each
            const barHeightOriginal = chartHeight - yScale(currentDataPoint.value);
            const barWidth = xScale.bandwidth();
            // const imgAspectRatio = 1; // Defined in outer scope, assumed to be 1
            const imgWidth = barWidth;
            const imgHeight = imgWidth / imgAspectRatio; // imgAspectRatio is 1 from outer scope

            const numImages_float = Math.ceil(barHeightOriginal / imgHeight) / 0.353;
            const effectiveNumImagesInStack = Math.floor(numImages_float);

            const groupOffsetY = -currentIndex * 50; // Vertical transform of the bar group

            let topOfStackLocalY;
            if (currentDataPoint.value === 0) {
                // For zero-value bars, target the base of the chart area within the group's Y offset.
                topOfStackLocalY = chartHeight;
            } else {
                // For non-zero bars, calculate top of the highest image.
                // Based on numImages_float calculation, effectiveNumImagesInStack should be >= 1 if value > 0.
                // The y-coord of the top of the (k)-th image (0-indexed stack) is
                // chartHeight - imgHeight*0.7 - (k + 1) * imgHeight*0.105
                // For the highest image, (k+1) becomes effectiveNumImagesInStack.
                topOfStackLocalY = chartHeight - imgHeight * 0.7 - effectiveNumImagesInStack * imgHeight * 0.105 + 20;
            }
            
            const actualStackTopY_for_this_bar = groupOffsetY + topOfStackLocalY;
            
            // The connecting line's vertical part ends at y = iconSize + 40 relative to the icon group's origin.
            // We want this end point (in chartGroup coords) to be actualStackTopY_for_this_bar.
            // iconGroupY + (iconSize + 40) = actualStackTopY_for_this_bar
            // So, iconGroupY = actualStackTopY_for_this_bar - iconSize - 40;
            const iconGroupTranslateY = actualStackTopY_for_this_bar - iconSize - 40;
            
            return `translate(${xScale(currentDataPoint.category) - iconSize - 20}, ${iconGroupTranslateY})`;
        });
    
    // Add clip paths for circular icons
    const defs = chartGroup.append("defs");
    
    processedData.forEach((d, i) => {
        const clipId = `clip-country-${i}`;
        
        defs.append("clipPath")
            .attr("id", clipId)
            .append("circle")
            .attr("cx", iconSize/2)
            .attr("cy", iconSize/2)
            .attr("r", iconSize/2 - 1);
    });
    
    // Add circular black border
    countryIcons.append("circle")
        .attr("cx", iconSize/2)
        .attr("cy", iconSize/2)
        .attr("r", iconSize/2)
        .attr("fill", "none")
        .attr("stroke", "#000")
        .attr("stroke-width", 1);
    
    // Add country flag images (clipped to circle)
    countryIcons.append("image")
        .attr("x", 0)
        .attr("y", 0)
        .attr("width", iconSize)
        .attr("height", iconSize)
        .attr("clip-path", (d, i) => `url(#clip-country-${i})`)
        .attr("xlink:href", d => images.field[d.category] || "");
    
    // Add dimension labels (country names)
    countryIcons.append("text")
        .attr("class", "dimension-label")
        .attr("x", iconSize + 5)
        .attr("y", iconSize/2 - 5)
        .text(d => d.category)
        .style("font-family", typography.label.font_family)
        .style("font-size", typography.label.font_size)
        .style("font-weight", "normal")
        .style("alignment-baseline", "middle")
        .style("fill", colors.text_color);
    
    // Format value with proper unit
    const formatValue = (val) => {
        if (val >= 1e9) {
            return `$${(val / 1e9).toFixed(1)}B`; // Billions
        } else if (val >= 1e6) {
            return `$${(val / 1e6).toFixed(1)}M`; // Millions
        } else if (val >= 1e3) {
            return `$${(val / 1e3).toFixed(1)}K`; // Thousands
        }
        return `$${val}`; // Regular
    };
    
    // Add value labels
    countryIcons.append("text")
        .attr("class", "value-label")
        .attr("x", iconSize + 5)
        .attr("y", iconSize/2 + 15)
        .text(d => formatValue(d.value))
        .style("font-family", typography.annotation.font_family)
        .style("font-size", typography.annotation.font_size)
        .style("font-weight", "bold")
        .style("alignment-baseline", "middle")
        .style("fill", colors.text_color);
    
    // Add connecting lines from labels to bars
    countryIcons.each(function(d, i) {
        const group = d3.select(this);
        const valueText = group.select(".value-label").node();
        const textWidth = valueText.getComputedTextLength ? valueText.getComputedTextLength() : 50;
        
        // Calculate the X coordinate for the bend in the connecting line,
        // such that the vertical part of the line aligns with the center of the bar.
        // The iconGroup's X transform is: xScale(d.category) - iconSize - 20
        // Let lineBendX_relative be the x-coordinate of the bend relative to the icon group.
        // We want: (xScale(d.category) - iconSize - 20) + lineBendX_relative = barCenterX_absolute
        // where barCenterX_absolute = xScale(d.category) + xScale.bandwidth() / 2
        // So, lineBendX_relative = (xScale(d.category) + xScale.bandwidth() / 2) - (xScale(d.category) - iconSize - 20)
        // lineBendX_relative = xScale.bandwidth() / 2 + iconSize + 20;
        const lineBendX_relative = xScale.bandwidth() / 2 + iconSize + 20;

        // Horizontal line
        group.append("line")
            .attr("x1", iconSize + 5 + textWidth + 5) // Start after value text
            .attr("y1", iconSize/2 + 15)
            .attr("x2", lineBendX_relative) // End at the calculated bend point
            .attr("y2", iconSize/2 + 15)
            .attr("stroke", "#000")
            .attr("stroke-width", 1)
            .attr("stroke-opacity", 0.7);
        
        // Vertical line
        group.append("line")
            .attr("x1", lineBendX_relative) // Start at the calculated bend point
            .attr("y1", iconSize/2 + 15)
            .attr("x2", lineBendX_relative) // Keep same X for vertical line
            .attr("y2", iconSize + 40) // Extend down toward bar
            .attr("stroke", "#000")
            .attr("stroke-width", 1)
            .attr("stroke-opacity", 0.7);
    });

    return svg.node();
}